import { getMovies } from "../../api/movies";
import { useQuery } from "react-query";



const Movies = () =>{

    const { status, data: movies } = useQuery("movies", getMovies);

    //console.log(movies)


    return(
        <div>
            <h1>Movies</h1>
            
            movies?.map( ({backdrop_path, title, overview}) => (
            <h3>{backdrop_path}</h3>
            <h3>{title}</h3>
            <h3>{overview}</h3>
        ));

        </div>  
    );
}; 

export default Movies;
